import React from "react";

class App extends React.Component {
    state = {
        data: [
            {
                src: "images/brulux.jpg",
                title: "Brulux",
                description: "Le debut"
            },
            {
                src: "images/DwCLD2gX0AAtrtf.jpg",
                title: "Chien",
                description: "Le debut2"
            },
            {
                src: "images/henni.jpg",
                title: "Henni",
                description: "Le debut3"
            },
            {
                src: "images/lafarge.jpg",
                title: "Lafarge",
                description: "Le debut4"
            },
            {
                src: "images/onepiecewall.jpg",
                title: "One ppiece",
                description: "Le debut5"
            },

        ]
    }

    render() {
        const data = this.state.data;
        return (
            <div className="wrapper">
                <div className="app">
                    {
                        data.map(item => (
                            <div className="card">
                                <img src={item.src} alt=""/>
                                <div>
                                    <h2>{item.title}</h2>
                                    <p>{item.description}</p>
                                    <a href="/">Read more</a>
                                </div>
                            </div>
                        ))
                    }
                </div>
            </div>
        );
    };
}

export default App;
